import React, { useEffect, useState } from 'react';
import Navbar from './navbar';
import users from './users'; // Importing the users array
import './profile.css';

const Profile = () => {
    const [loggedInUser, setLoggedInUser] = useState(null);

    useEffect(() => {
        // Fetch the logged-in user email from localStorage
        const userEmail = localStorage.getItem("UserEmail");

        if (userEmail) {
            // Find the user details from the users array
            const user = users.find(u => u.email === userEmail);
            if (user) {
                setLoggedInUser(user);
            }
        }
    }, []);

    return (
        <div className="profile">
            <Navbar />
            <div className="profile-container">
                <h1>User Profile</h1>
                {loggedInUser ? (
                    <div className="user-details">
                        <p><strong>Name:</strong> {loggedInUser.name}</p>
                        <p><strong>Email:</strong> {loggedInUser.email}</p>
                        <p><strong>Phone:</strong> {loggedInUser.phone}</p>
                    </div>
                ) : (
                    <p className="error-msg">No user logged in</p>
                )}
            </div>
        </div>
    );
};

export default Profile;
